import Cabecalho from "../../Components/Cabecalho/Index";
import DivPadrao from "../../Components/DivPadrao/DivPadrao";
import Contato from "../../Components/FormContato/Contato";
import Rodape from "../../Components/Rodape/Rodape";
import "./TelaContato.css"

const TelaContato = () => {
    return (<div>
        <Cabecalho/>
        <div className="container-tela-contato"></div>
        <DivPadrao titulo="Entre em Contato" texto="contato@faraway.com.br"/>
        <Contato/>
        <Rodape/>

    </div>);
}

export default TelaContato;
